import * as React from "react"
import { cn } from "../../lib/utils";



const ContactContainer = React.forwardRef(({ className, ...props }, ref) => (
    <div
    ref={ref}
    className={cn("grid sm:grid-cols-2 items-start gap-16 p-4 mx-auto max-w-4xl bg-white font-[sans-serif]", className)}
    {...props} />
))
ContactContainer.displayName = "ContactContainer"




export { ContactContainer }
